import { Typography } from "@material-ui/core";
import React from "react";

const ADate = ()=>{
    const current = new Date();
    const date = `${current.getDate()}/${current.getMonth()+1}/${current.getFullYear()}`;
    return(
        <Typography>{date}</Typography>
    )
};

export default ADate;
